import React, {Component} from 'react'
import './style.css'

export default class Publicacoes extends Component{
    render(){
        return(
            <div className="post">
                <h3>Teste</h3>
                <div className="conteudo">
                    <div className="data">
                        <p>29/12/2002 15:30</p>
                    </div>
                        <p>Android Studio é um ambiente de desenvolvimento integrado p
                            ara desenvolver para a plataforma Android.
                             Foi anunciado em 16 de Maio de 2013 na 
                            conferência Google I/O. Android Studio é 
                            disponibilizado gratuitamente sob a Licença Apache 2.0.</p>
                    <div className="descricao">

                    </div>
                </div>
            </div>
        );
    }
}
